    <div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Assurance courtage sérénité siège social 25 boulevard omer Sarrault 11000 Carcassonne capital de 65 000,00€. Rcs de Carcassonne N° 799031182.</div><div class="t m0 x2 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">Orias 14000663</div><div class="t m0 x0 h3 y3 ff2 fs1 fc0 sc0 ls0 ws0">acs carpentras</div><div class="t m0 x0 h4 y4 ff3 fs2 fc0 sc0 ls0 ws0">105 rue d&apos;Inguimbert</div><div class="t m0 x0 h4 y5 ff3 fs2 fc0 sc0 ls0 ws0">84200 carpentras</div><div class="t m0 x0 h4 y6 ff3 fs2 fc0 sc0 ls0 ws0">09 52 92 79 30</div><div class="t m0 x3 h5 y7 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h5 y8 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y9 ff1 fs4 fc0 sc0 ls0 ws0">CONTRAT DE GESTION</div><div class="t m0 x0 h7 ya ff3 fs5 fc0 sc0 ls0 ws0">Le souscripteur s&apos;engage à déclarer en cours de contrat des qu&apos;il en a connaissance :</div><div class="t m0 x0 h7 yb ff3 fs5 fc0 sc0 ls0 ws0">• Tout fait ou circonstance modifiant les déclarations faites lors de la souscription</div><div class="t m0 x0 h7 yc ff3 fs5 fc0 sc0 ls0 ws0">• Toutes suspensions ou retrait de permis de conduire du (des) conducteur (s) désigné(s) quel qu&apos;en soit</div><div class="t m0 x0 h7 yd ff3 fs5 fc0 sc0 ls0 ws0">la durée ou les motifs</div><div class="t m0 x0 h7 ye ff3 fs5 fc0 sc0 ls0 ws0">• Déménagement ou tout autre changement de situation</div><div class="t m0 x0 h8 yf ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y10 ff3 fs5 fc0 sc0 ls0 ws0">A transmettre à l&apos;assureur dans un délai de 30 jours les documents non fournis lors de la souscription :</div><div class="t m0 x0 h7 y11 ff3 fs5 fc0 sc0 ls0 ws0">• La photocopie de la carte grise du véhicule au nom du souscripteur</div><div class="t m0 x0 h7 y12 ff3 fs5 fc0 sc0 ls0 ws0">• La photocopie recto verso du permis de conduire en cours de validé</div><div class="t m0 x0 h7 y13 ff3 fs5 fc0 sc0 ls0 ws0">• L&apos;original de votre relevé d&apos;information datant de moins de 2 mois et couvrant vos 36 derniers mois</div><div class="t m0 x0 h7 y14 ff3 fs5 fc0 sc0 ls0 ws0">d&apos;assurance (à réclamer à votre ancien assureur)</div><div class="t m0 x0 h7 y15 ff3 fs5 fc0 sc0 ls0 ws0">• Le mandat de prélèvement joint complété et signé, accompagné d&apos;un RIB, nécessaires au paiement de</div><div class="t m0 x0 h7 y16 ff3 fs5 fc0 sc0 ls0 ws0">vos prochaines échéances</div><div class="t m0 x0 h7 y17 ff3 fs5 fc0 sc0 ls0 ws0">• Un exemplaire des présentes dispositions particulières signées et paraphées par vos soins.</div><div class="t m0 x0 h8 y18 ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y19 ff3 fs5 fc0 sc0 ls0 ws0">La société acs carpentras s&apos;engage à gérer l&apos;ensemble des contrats souscrits auprès de cette dernière.</div><div class="t m0 x0 h7 y1a ff3 fs5 fc0 sc0 ls0 ws0">Pour la gestion des contrats la compagnie vous facture une cotisation de gestion prélevée selon le</div><div class="t m0 x0 h7 y1b ff3 fs5 fc0 sc0 ls0 ws0">fractionnement choisi sur votre compte bancaire.</div><div class="t m0 x0 h8 y1c ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y1d ff4 fs5 fc0 sc0 ls0 ws0">Mandat de prélèvement</div><div class="t m0 x0 h7 y1e ff3 fs5 fc0 sc0 ls0 ws0">J&apos;autorise acs carpentras à prélever sur le compte {{$contrat->IBAN}} au titre des</div><div class="t m0 x0 h7 y1f ff3 fs5 fc0 sc0 ls0 ws0">cotisations à leurs échéances ainsi que les sommes pouvant être dues au titre du présent contrat. La</div><div class="t m0 x0 h7 y20 ff3 fs5 fc0 sc0 ls0 ws0">référence unique du mandat est CGM{{$contrat->id}} et le numéro ics unique de FR-ID{{$contrat->id}}</div><div class="t m0 x0 h8 y21 ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y22 ff4 fs5 fc0 sc0 ls0 ws0">Votre cotisation</div><div class="t m0 x0 h7 y23 ff3 fs5 fc0 sc0 ls0 ws0">La cotisation s&apos;élève à {{$contrat->montant}},00 € qui sera prélevé mensuellement. Le prélévement sera effectué le {{$contrat->jourprelevement}} du</div><div class="t m0 x0 h7 y24 ff3 fs5 fc0 sc0 ls0 ws0">mois sur le compte indiqué ci-dessus. Votre cotisation est présentée hors éventuelles évolutions tarifaires</div><div class="t m0 x0 h7 y25 ff3 fs5 fc0 sc0 ls0 ws0">réglementaires. Elle reste valable jusqu&apos;à la date de prochaine échéance de votre contrat.</div><div class="t m0 x0 h8 y26 ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y27 ff3 fs5 fc0 sc0 ls0 ws0">{{$contrat->client->nom}} {{$contrat->client->prenom}} demeurant    {{$contrat->client->nomvoie}}  {{$contrat->client->typevoie}}  {{$contrat->client->rue}}  {{$contrat->client->ville}}  {{$contrat->client->cp}}  reconnais avoir pris</div><div class="t m0 x0 h7 y28 ff3 fs5 fc0 sc0 ls0 ws0">connaissance du présent document avant la conclusion du contrat d&apos;assurance ci-joint mentionné et</div><div class="t m0 x0 h7 y29 ff3 fs5 fc0 sc0 ls0 ws0">déclare avoir expressément accepté les conditions de souscriptions.</div><div class="t m0 x0 h8 y2a ff3 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y2b ff3 fs5 fc0 sc0 ls0 ws0">Fait en deux exemplaires, </div><div class="t m0 x0 h7 y2c ff3 fs5 fc0 sc0 ls0 ws0">A carpentras, Le  {{$contrat->created_at}} </div><div class="t m0 x0 h9 y2d ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x5 h4 y2e ff1 fs2 fc0 sc0 ls0 ws0">Signature de l&apos;intermédiaire <span class="_ _0"> </span>  Signature du souscripteur</div><div class="t m0 x6 h5 y2f ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x7 h5 y30 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h8 y31 ff3 fs6 fc0 sc0 ls0 ws0">En signant ce formulaire de mandat, vous autorisez Assurance Courtage Sérénité  à envoyer des instructions à votre banque pour débiter votre compte, et votre</div><div class="t m0 x0 h8 y32 ff3 fs6 fc0 sc0 ls0 ws0">banque à débiter votre compte conformément aux instructions d&apos;<span class="ff1">Assurance Courtage Sérénité </span>. Vous bénéficiez du droit d’être remboursé par votre banque suivant</div><div class="t m0 x0 h8 y33 ff3 fs6 fc0 sc0 ls0 ws0">les conditions décrites dans la convention que vous avez passée avec elle. Une demande de remboursement doit être présentée dans les 8 semaines suivant la date</div><div class="t m0 x0 h8 y34 ff3 fs6 fc0 sc0 ls0 ws0">de débit de votre compte pour un prélèvement autorisé.</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y35 w1 ha" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Assurance courtage sérénité siège social 25 boulevard omer Sarrault 11000 Carcassonne capital de 65 000,00€. Rcs de Carcassonne N° 799031182.</div><div class="t m0 x2 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">Orias 14000663</div><div class="t m0 x8 hb y36 ff3 fs8 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 hb y37 ff2 fs8 fc0 sc0 ls0 ws0">acs carpentras</div><div class="t m0 x0 h4 y38 ff1 fs2 fc0 sc0 ls0 ws0">105 rue d&apos;Inguimbert</div><div class="t m0 x0 h4 y39 ff1 fs2 fc0 sc0 ls0 ws0">84200 carpentras</div><div class="t m0 x0 h4 y3a ff1 fs2 fc0 sc0 ls0 ws0">09 52 92 79 30</div><div class="t m0 x0 hb y3b ff3 fs8 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h5 y3c ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x9 h7 y3d ff2 fs5 fc0 sc0 ls0 ws0">DISPOSITION GENERALES</div><div class="t m0 xa h7 y3e ff2 fs5 fc0 sc0 ls0 ws0">AVANT DE CLASSER VOTRE CONTRAT, LISEZ-LE ATTENTIVEMENT</div><div class="t m0 xb h9 y3f ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h7 y40 ff2 fs5 fc0 sc0 ls0 ws0">Article 1 : PIECES</div><div class="t m0 x0 h4 y41 ff1 fs2 fc0 sc0 ls0 ws0">Vous devez fournir tout les justiﬁcatifs demandés lors de l&apos;établissement du ou des contrat(s), Dans un délai de trente jours</div><div class="t m0 x0 h4 y42 ff1 fs2 fc0 sc0 ls0 ws0">aﬁn d&apos;éviter la résiliation du ou des contrat(s) par le preneur de risque.</div><div class="t m0 x0 h9 y43 ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y44 ff2 fs2 fc0 sc0 ls0 ws0">Article 2 : DEBUT ET FIN DE CONTRAT</div><div class="t m0 x0 h9 y45 ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y46 ff2 fs2 fc0 sc0 ls0 ws0">Article 2.1: Début</div><div class="t m0 x0 h4 y47 ff1 fs2 fc0 sc0 ls0 ws0">La date de début de ce contrat est celle à laquelle vous souscrivez votre premier contrat par le biais de notre société. Sauf</div><div class="t m0 x0 h4 y48 ff1 fs2 fc0 sc0 ls0 ws0">accord entre les deux parties.</div><div class="t m0 x0 h9 y49 ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y4a ff2 fs2 fc0 sc0 ls0 ws0">Article 2.2 : Durée</div><div class="t m0 x0 h4 y4b ff1 fs2 fc0 sc0 ls0 ws0">Ce contrat prend ﬁn lors de la résiliation de votre dernier contrat souscrit et géré par notre société</div><div class="t m0 x0 h9 y4c ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y4d ff2 fs2 fc0 sc0 ls0 ws0">Article 3 : COTISATION</div><div class="t m0 x0 h9 y4e ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y4f ff2 fs2 fc0 sc0 ls0 ws0">Article 3.1 : Quand et comment payer?</div><div class="t m0 x0 h4 y50 ff1 fs2 fc0 sc0 ls0 ws0">Les cotisations sont à payer par prélèvement à la date et fractionnement déﬁni lors de la souscription du présent contrat.</div><div class="t m0 x0 h4 y51 ff2 fs2 fc0 sc0 ls0 ws0">Article 3.2 : Révision du tarif</div><div class="t m0 x0 h4 y52 ff1 fs2 fc0 sc0 ls0 ws0">Nous pouvons être amenés à modiﬁer nos tarifs à la première échéance principale, lorsqu&apos;au cours de l&apos;année vous avez</div><div class="t m0 x0 h4 y53 ff1 fs2 fc0 sc0 ls0 ws0">plus de deux sinistres et, ou,  en cas de changement de véhicule plus de deux fois dans l&apos;année, l&apos;augmentation n&apos;excédera</div><div class="t m0 x0 h4 y54 ff1 fs2 fc0 sc0 ls0 ws0">pas plus 2 euros mensuel. Vous en serez informé lors de l&apos;envoie de votre avis d&apos;échéance. Vous aurez alors la faculté de</div><div class="t m0 x0 h4 y55 ff1 fs2 fc0 sc0 ls0 ws0">prendre rendez vous pour l&apos;explication de cette augmentation.</div><div class="t m0 x0 h9 y56 ff3 fs7 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y57 ff2 fs2 fc0 sc0 ls0 ws0">Article 3.3 : Rejet de prélévement</div><div class="t m0 x0 hc y58 ff1 fs9 fc1 sc0 ls0 ws0">Tout rejet de prélèvement entrainera des frais d&apos;impayés,pouvant varier selon la durée et le montant de l&apos;impayé.</div><div class="t m0 x0 hc y59 ff1 fs9 fc1 sc0 ls0 ws0">Assurance courtage sérénité se réserve le droit en cas de non régularisation de votre impayé dans les plus brefs</div><div class="t m0 x0 hc y5a ff1 fs9 fc1 sc0 ls0 ws0">délais de ne plus exercer son devoir en tant que courtier. </div><div class="t m0 x0 h5 y5b ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h4 y5c ff2 fs2 fc1 sc0 ls0 ws0">Article 3.4 : Résiliation non Paiement</div><div class="t m0 x0 hc y5d ff1 fs9 fc1 sc0 ls0 ws0">Si vous ne payez pas la cotisation ou une fraction de cotisation dans les 10 jours de son échéance, nous pouvons</div><div class="t m0 x0 hc y5e ff1 fs9 fc1 sc0 ls0 ws0">poursuivre l’exécution du contrat en justice. Sous réserve de dispositions plus favorables, la loi nous autorise</div><div class="t m0 x0 hc y5f ff1 fs9 fc1 sc0 ls0 ws0">également à suspendre les garanties de votre contrat 30 jours après l’envoi d’une lettre recommandée de mise en</div><div class="t m0 x0 hc y60 ff1 fs9 fc1 sc0 ls0 ws0">demeure à votre dernier domicile connu, voire à résilier votre contrat 10 jours après l’expiration de ce délai de 30</div><div class="t m0 x0 hc y61 ff1 fs9 fc1 sc0 ls0 ws0">jours (article L113-3 du Code des assurances).</div><div class="t m0 x0 hc y62 ff1 fs9 fc1 sc0 ls0 ws0">En cas de résiliation, vous restez redevable de la portion de cotisation aﬀérente à la période écoulée jusqu’à la date</div><div class="t m0 x0 hc y63 ff1 fs9 fc1 sc0 ls0 ws0">de résiliation, majorée des frais de poursuites et de recouvrement éventuels ainsi  que d’une pénalité correspondant</div><div class="t m0 x0 hc y64 ff1 fs9 fc1 sc0 ls0 ws0">à  6 mois de cotisation maximum sans pouvoir excéder la portion de cotisation restant due jusqu’au terme de</div><div class="t m0 x0 hc y65 ff1 fs9 fc1 sc0 ls0 ws0">l’échéance annuelle.</div><div class="t m0 x0 hc y66 ff1 fs9 fc1 sc0 ls0 ws0"> </div><div class="t m0 x0 h8 y67 ff1 fs6 fc1 sc0 ls0 ws0">Les informations contenues dans le présent document ne sont destinées à être utilisées par ASSURANCE COURTAGE SERENITE que pour la gestion de la relation avec</div><div class="t m0 x0 h8 y68 ff1 fs6 fc1 sc0 ls0 ws0">son client. Elles pourront donner lieu à l&apos;exercice par ce dernier de ses droits d&apos;opposition, d&apos;accès et de rectiﬁcation tels que prévus aux articles 38 et suivants de la</div><div class="t m0 x0 h8 y69 ff1 fs6 fc1 sc0 ls0 ws0">Loi n°78-17 du 6 janvier 1978 modiﬁée relative à l&apos;informatique. Ce mandat vaut pré-notiﬁcation pour les prochains prélèvements SEPA qui seront eﬀectués dans les</div><div class="t m0 x0 h8 y6a ff1 fs6 fc1 sc0 ls0 ws0">conditions décrites dans vos conditions particulières</div><div class="t m0 x8 hc y6b ff1 fs9 fc1 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
